import './Table.css';
import TableHeader from '.TableHeader';
import TableBody from '.TableBody';
import TableFooter from '.TableFooter';

const Table = ({
  title
}) => {
  return (
    <div className="table">
        <TableHeader></TableHeader>
        <TableBody></TableBody>
        <TableFooter></TableFooter>
    </div>
  );
}

export default Table;
